import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom'
import axios from 'axios'
import { getToken } from '../utils/localStorageUtil';

const EditEtudiant = () => {
    const [etudiants, setEtudinant] = useState();
    const getEtudiant = () => {
        axios.get(`http://localhost:8080/etudiant/${idEtu}`,
            {
                headers: { "token": `Bearer ${getToken()}` }
            })
            .then(res => {
                setEtudinant(res.data)
            })
            .catch(err => {
                console.log(err);
            })
    }
    useEffect(() =>
        getEtudiant(),
        []
    )
    const { idEtu } = useParams();
    return (
        <div>
            {
                etudiants.map((index, item) => (
                    <h1>{item.firstName}</h1>
                ))
            }
        </div>
    );
};

export default EditEtudiant;
